import React, { CSSProperties } from 'react';

const navigationStyle: CSSProperties = {

    backgroundColor: "pink",
    color: "black",
    width: "100%",
    position: "fixed",
    bottom: 0,

  };

export default function NavigationBar() {
  return (
    <nav style={navigationStyle}>
      <ul>
          <a href="/home" style={{justifyContent: "space-between"} }>Create</a>

          <a href="/about" style={{justifyContent: "space-between"} }>About</a>

          <a href="/products"style={{justifyContent: "space-between"} }>Home</a>

          <a href="/contact"style={{justifyContent: "space-between"} }>Profile</a>

      </ul>
    </nav>
  );
}
